<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="installation-d-un-ide-android">Installation d'un IDE Android</a>
</h1>
<div class="Section6"><br><div class="GSummary2"><div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#installation-d-un-ide-android_installation-de-android-studio">Installation de Android Studio</a>
</div>
</div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="installation-d-un-ide-android_installation-de-android-studio" href="#installation-d-un-ide-android">Installation de Android Studio</a>
</h2><br>Le but de cette section est de vous prendre à installer Android Studio dans votre machine de développement. Android Studio est un IDE (Integrated Development Environment), un environnement de développement intégré Android très puissant qui fournit toute la chaîne complète de réalisation d'une application Android, depuis la phase de création du projet jusqu'à son déploiement dans un appareil virtuel Android AVD (Android Virtual Device) ou dans un appareil réel Android, en passant par les phases de développement et de débogage de l'application.<br><br>Dans l'exemple qui suit, nous expliquerons comment installer Android Studio sur un système Windows.<br><br>Résultat:<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Téléchargement d'Android Studio:<br><br><a class="GLink3 Link4" style=" color: lime;" href="https://developer.android.com/studio" target="_blank">https://developer.android.com/studio</a><br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
